Deixa de ser frouxo xandaum, e eu que comeram minha bunda na prisão 😭😭 lulão nunca mais foi o mesmo.

@Lulano_Telegram

Tudo de errado com esta charge:
- Os manifestantes não são bandidos;
- Bandido condenado não pode ter celular mesmo, pode?
- Ninguém está pedindo auxílio-reclusão;
- Ninguém da Direita defende fim dos Direitos humanos. Nós criticamos a militância dos direitos humanos, que só defende criminosos. Cadê eles pedindo a soltura de idosos e crianças. Cadê eles defendendo habeas corpus dos que não participaram do vandalismo?

Socialistas e seus sofismas...
